import './App.css';
import { Routes, Route } from 'react-router-dom'

function App() {
    return (
        <div className="App">
            <header className="App-header">
            <Routes>
                <Route to="about" element={<h1>About</h1>}>About</Route>
            </Routes>
            </header>
        </div>
    );
}

export default App;
